import React from 'react'
import ReactPaginate from 'react-paginate';

const Pagination = () => {
  return (
    <ReactPaginate
    breakLabel="..."
    nextLabel="next >"
    previousLabel="<"
    onPageChange={event => console.log(event)}
    pageRangeDisplayed={4}
    pageCount={3}
    renderOnZeroPageCount={null}
  />

  )
}

export default Pagination
